import React, {Component} from "react";

class Background extends Component{

	render(){
		return(
			<svg className="backgroundSVG" width="500" height="100" viewBox="25 25 500 100">

			  <circle r="25" cx="25" cy="25" fill="#f00" />
			</svg>
		);
	}
}

export default Background;
